'use strict';
let GetRolloverProfilesMessage = require('./GetRolloverProfilesMessage.js');
class GetRolloverProfilesMessageBuilder extends GetRolloverProfilesMessage {
    addRolloverProfile(rolloverProfile) {
        this.rolloverProfilesList.add(rolloverProfile);
    }
    addRolloverProfiles(rolloverProfiles) {
        let i;
        if (rolloverProfiles != null) {
            for (i = 0; i <= rolloverProfiles.length() - 1; i += 1) {
                this.addRolloverProfile(rolloverProfiles.get(i));
            }
        }
    }
    setAccountId(accountId) {
        this.accountId = accountId;
    }
    build() {
        return this;
    }
}
module.exports = GetRolloverProfilesMessageBuilder
